import NavItem from './NavItem';
import './navbar.css';
import {IconContext} from 'react-icons'
import { BsBell , BsChatDots , BsCalendar , BsThreeDots} from "react-icons/bs";
import { HiOutlineUserGroup , HiOutlineShoppingBag } from "react-icons/hi";
import { IoCallOutline } from "react-icons/io5";
import { AiOutlineFile } from "react-icons/ai";

function Navbar(){
    return(
        <IconContext>
            <div className='Navbar-wrapper'>
            <div className='Navbar-topitem'>
                <NavItem icon={<BsBell color="white" size="1.3em"/>} title='Activity'/> 
                <NavItem icon={<BsChatDots/>} title=''/>
                <NavItem icon={<HiOutlineUserGroup/>} title=''/>
                <NavItem icon={<HiOutlineShoppingBag/>} title=''/>
                <NavItem icon={<BsCalendar/>} title=''/>
                <NavItem icon={<IoCallOutline/>} title=''/>
                <NavItem icon={<AiOutlineFile/>} title=''/>
                <NavItem icon={<BsThreeDots/>} title=''/>

            </div>
            <div className='Navbar-bottomitem'>
                <NavItem icon='' title=''/>
                <NavItem icon='' title=''/>


            </div>

        </div>
        </IconContext>

    );
}

export default Navbar;
